import React from 'react';

function Publications() {
  return (
    <div className="">
      <h5>Conference and Journal Papers</h5>
      <div className="pub-wrapper">
        <b>Investigating How Users in the United States Encounter and Deal With Misinformation on WhatsApp During COVID-19</b><br/>
        <span>Oishee Chakrabarti*, K. J. Kevin Feng*, Kejing Li*, Kevin Song*, Marshini Chetty</span><br/>
        <span><i>In submission</i></span>
      </div>

      <img src={ require('./assets/img/construction.gif').default } style={{maxWidth: 500}}/>

    </div>
  );
}

export default Publications;
